import React from 'react'
import Header from '../components/Header';
import Footer from '../components/Footer'
import '../components/css/Home.css';
import data from "../assets/headshots/headshots";

export default function Members() {
    const images = require.context('../assets/headshots', true);

    let divs = [];
    data.forEach((obj) => {
        let name = obj.name;
        let image = images(`./${obj.photo}`);

        console.log(image);
        let role = obj.role;
        divs.push(<div className="member-card">
                        <div className="member-image"><img src={image} alt={name}/></div>
                        <h2>{name}</h2>
                        <h4>{role}</h4>
                    </div>);
    })


    return (
        <div>
            <Header />
            {divs}
            <Footer />            
        </div>
    )
}
